'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term4' => 'Perkhidmatan-perkhidmatan yang disediakan &#34;as-is&#34;. &amp;vendorShortName;, para penyumbang, pemberi-pemberi lesennya, dan pengedar-pengedar, menafikan semua jaminan, sama ada yang dinyatakan atau yang tersirat, termasuk tanpa batasan, jaminan-jaminan bahawa perkhidmatan-perkhidmatan yang boleh diperdagangkan dan sesuai untuk tujuan-tujuan anda yang tertentu. Anda menanggung risiko secara menyeluruh untuk memilih perkhidmatan-perkhidmatan untuk apa jua tujuan anda dan kepada kualiti dan prestasi perkhidmatan-perkhidmatan. Sesetengah bidang kuasa tidak membenarkan pengecualian atau pembatasan jaminan-jaminan yang tersirat, jadi penafian ini tidak mungkin dikenakan kepada anda.',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term5' => 'Kecuali dikehendaki oleh undang-undang, &amp;vendorShortName;, penyumbang-penyumbang, pemberi-pemberi lesen, dan pengedar-pengedar tidak akan bertanggungjawab atas kerosakan yang tidak langsung, ganti rugi khas, sampingan, berbangkit, punitif, atau kerosakan teladan dinyatakan daripada atau dalam mana cara berkenaan untuk digunakan daripada &amp;brandShortName; dan servisnya. Pengurus liabiliti dibawah terma ini akan tidak melebihi $500 (lima ratus dolar). Sesetengah jurisdiksi tidak membenarkan pengecualian atau had daripada sebarang kerosakan, namun pengecualian ini dan had diboleh dimohon untuk anda.',
